import React from "react";
import "../styles/Tabs.css";
import TabCard from "../template-parts/TabCard";

const Tabs = ({ title, text, tabs, sectioncounter }) => {
  console.log("Tabs Data:", tabs);

  return (
    <div className="container pt-5 pb-5">
      {title && <h2 className="text-center">{title}</h2>}
      {text && <div className="text-center" dangerouslySetInnerHTML={{ __html: text }} />}

      {/* Main Tabs */}
      <ul className="nav nav-pills mb-3" role="tablist">
        {tabs?.map((tab, index) => (
          <li className="nav-item" role="presentation" key={index}>
            <button
              className={`nav-link ${index === 0 ? "active" : ""}`}
              data-bs-toggle="pill"
              data-bs-target={`#tab-${sectioncounter}-${index}`}
              type="button"
              role="tab"
              aria-selected={index === 0 ? "true" : "false"}
            >
              {tab.generalTabTitle}
            </button>
          </li>
        ))}
      </ul>

      <div className="tab-content">
        {tabs?.map((tab, index) => (
          <div
            key={index}
            className={`tab-pane fade ${index === 0 ? "show active" : ""}`}
            id={`tab-${sectioncounter}-${index}`}
            role="tabpanel"
          >
            {/* Internal Tabs */}
            {tab?.internalTab && tab.internalTab.length > 0 && (
              <>
                <ul className="nav nav-pills mb-3" role="tablist">
                  {tab.internalTab.map((intTab, intIndex) => (
                    <li className="nav-item" role="presentation" key={intIndex}>
                      <button
                        className={`nav-link ${intIndex === 0 ? "active" : ""}`}
                        data-bs-toggle="pill"
                        data-bs-target={`#internal-tab-${sectioncounter}-${index}-${intIndex}`}
                        type="button"
                        role="tab"
                        aria-selected={intIndex === 0 ? "true" : "false"}
                      >
                        {intTab.title}
                      </button>
                    </li>
                  ))}
                </ul>

                {/* Internal Tab Content */}
                <div className="tab-content">
                  {tab.internalTab.map((intTab, intIndex) => {
                    // Extract the first card as the "Info Card"
                    const infoCard = intTab.tabCard[0];
                    const remainingCards = intTab.tabCard.slice(1);

                    return (
                      <div
                        key={intIndex}
                        className={`tab-pane fade ${intIndex === 0 ? "show active" : ""}`}
                        id={`internal-tab-${sectioncounter}-${index}-${intIndex}`}
                        role="tabpanel"
                      >
                        <h4>{intTab.title}</h4>
                        <a href={intTab.button.url} className="btn btn-primary">
                          {intTab.button.text}
                        </a>

                        {/* Info Card - Appears First */}
                        {infoCard && (
                          <div className="row mb-3">
                            <div className="col-md-12">
                              <div className="card bg-light">
                                <div className="card-body">
                                  <h5 className="card-title">{infoCard.title}</h5>
                                  <ul>
                                    {infoCard.row.map((rowItem, rowIndex) => (
                                      <li key={rowIndex}>{rowItem.text}</li>
                                    ))}
                                  </ul>
                                </div>
                              </div>
                            </div>
                          </div>
                        )}

                        {/* Remaining Cards */}
                        <div className="row">
                          {remainingCards.map((card, cardIndex) => (
                            <div key={cardIndex} className="col-md-4">
                              <div className="card">
                                <div className="card-body">
                                  <h5 className="card-title">{card.title}</h5>
                                  <ul>
                                    {card.row.map((rowItem, rowIndex) => (
                                      <li key={rowIndex}>{rowItem.text}</li>
                                    ))}
                                  </ul>
                                </div>
                              </div>
                            </div>
                          ))}
                        </div>
                      </div>
                    );
                  })}
                </div>
              </>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Tabs;
